def final_player_after_passes(N, initial_id, passes):
    cholder = initial_id
    preholder = initial_id
    for i in range(N):
        query = passes[i]
        if query.startswith(''):
            (cholder, preholder) = back(cholder, preholder)
        else:
            temp = query.split()
            id = int(temp.pop())
            (cholder, preholder) = push(id, cholder, preholder)
    return cholder

def push(id, cholder, preholder):
    preholder = cholder
    cholder = id
    return (cholder, preholder)

def back(cholder, preholder):
    temp = cholder
    cholder = preholder
    preholder = temp
    return (cholder, preholder)
